import React from 'react'
import { Bar } from "react-chartjs-2"

class TemperatureGraph extends React.Component {
    constructor(props) {
        super(props)
    }
    render () {
        return (
            <div id="TemperatureGraph">
                <Bar
                    data={{
                        labels: ["Jan", "Feb", "Mar"],
                        datasets: [
                            {
                                label: "# of votes",
                                data: [1, 2, 3]
                            }
                        ]
                    }}
                    height={400}
                    width={600}
                    options={{
                        maintainAspectRatio: false
                    }}
                />
            </div>
        )
    }
}
export default TemperatureGraph
